import React from 'react';
import {Tag,Popconfirm,Tooltip,Button} from 'antd';
import {DeleteOutlined,FolderOpenOutlined} from '@ant-design/icons';
const Item = (props) => {
    console.log(props.e);
    return (
            <tr key={props.e.id}>
                <td>{props.e.key}</td>
                <td>{props.e.employeeCode}</td>
                <td>{props.e.employeeName}</td>
                <td>
                    {props.e.department}
                </td>
                <td>{props.e.position}</td>
                <td>
                   {
                       props.e.workingShift
                   }
                </td>
               
                <td>{props.e.startDate}</td>
                <td>{props.e.endDate}</td>
                <td>
                    <Tooltip title="edit here">
                        <Button
                            className="update"
                            shape="circle"
                            icon={<FolderOpenOutlined/>}
                            //onClick={handle}
                            data-toggle="modal"
                            data-target="#updatestudent"
                        />
                    </Tooltip>
                    <Popconfirm
                        placement="top"
                        title='Are you sure to delete this employee?'
                       // onConfirm={onDelete}
                        htmlType="submit"
                        okText="Yes"
                        cancelText="No"
                    >
                        <Tooltip title="delete here">
                            <Button
                                className="delete"
                                shape="circle"
                                icon={<DeleteOutlined />}
                            />
                        </Tooltip>
                    </Popconfirm>
                </td>
            </tr>
    );
}
export default Item;
